import axios from 'axios';

const proxyURL = 'https://cors-anywhere.herokuapp.com';

const api = axios.create({
    baseURL: `http://52.45.128.89`,
});

api.defaults.headers['Access-Control-Allow-Origin'] = '*';

export default api;
